import React from 'react';
import logo from '../../assets/logo.svg';
import './Home.css';

function Home() {
    return (
            <header className="App-header">
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                </a>
            </header>
    );
}

export default Home;
